import React, { Component } from 'react';
import { Link, NavLink } from 'react-router-dom';
import { Navbar,Collapse, Nav, NavItem } from 'reactstrap';
import PropTypes from 'prop-types';

import {  AppNavbarBrand} from '@coreui/react';
import logo from '../assets/img/brand/logo.png'

 
const propTypes = {
  children: PropTypes.node,
};

const defaultProps = {};

class DefaultHeader extends Component {
  render() {

    // eslint-disable-next-line
    const { children, ...attributes } = this.props;

    return (
      <React.Fragment>
        <div class="container">

          <button class="navbar-toggler" type="button" data-toggle="collapse" data-target="#navbarTogglerDemo01" aria-controls="navbarTogglerDemo01" aria-expanded="false" aria-label="Toggle navigation">
          <span class="navbar-toggler-icon"></span>
          </button>
          <Collapse class="navbar-collapse" id="navbarTogglerDemo01">
                <ul class="navbar-nav mr-auto mt-2 mt-lg-0">
              <li class="nav-item active">
                <a class="nav-link" href="#">Home <span class="sr-only">(current)</span></a>
              </li>
              <li class="nav-item">
                <a class="nav-link" href="#">AboutUs</a>
              </li>
              <li class="nav-item">
                <a class="nav-link disabled" href="#" tabindex="-1" aria-disabled="true">Disabled</a>
              </li>
            </ul>
          </Collapse>

        <AppNavbarBrand
          full={{ src: logo, width: 50, height: 50, alt: 'Tokie Foundation Logo' }}
          minimized={{ src: logo, width: 30, height: 30, alt: 'Tokie Foundation Logo' }}
        />
          <Nav className="d-md-down-none" >
            <NavItem className="px-3">
              <NavLink to="/Home" className="nav-link" >Home</NavLink>
            </NavItem>
            <NavItem className="px-3">
              <Link to="/AboutUs" className="nav-link">About Us</Link>
            </NavItem>
            <NavItem className="px-3">
              <NavLink to="/HowToHelp" className="nav-link">How To Help</NavLink>
            </NavItem>
          </Nav>
        </div>
      </React.Fragment>
    );
  }
}

DefaultHeader.propTypes = propTypes;
DefaultHeader.defaultProps = defaultProps;

export default DefaultHeader;
